import logo from './logo.svg';
import './App.css';
import axios from "axios";
import {useState, useEffect} from "react";

const TestAxios = () => {
  const url = "http://localhost:8080/api/v1/registration/testaxios";
  const fetchAxios = () => {
    axios.get(url).then(res => {console.log(res)});
  };

  useEffect(() => {
    fetchAxios();
  }, []);
};

function App() {
  return (
    <div className="App">
      <TestAxios/>
    </div>
  );
}

export default App;
